            @keyframes ro{
    0%{

    }
    30%{
        transform:translateX(0px);
    }
    50%{
        transform:translateX(0px);
    }
    70%{
        transform:translateX(0px);

    85%{

    }
}

        transform:translateY(10px);
    }
}

}

    from{

    }

        transform: rotateZ(15deg)
    }
}

transform-origin: center left;
transform-box:fill-box;
}

transform-box:fill-box;
}

    to{
